import "./style.css";
import logo from "../../assets/logo.svg";

export const Header = ({ setIsLogged }) => {
  return (
    <header className="header">
      <div className="container">
        <a href="./index.html">
          <img src={logo} alt="" />
        </a>
        <button onClick={() => setIsLogged(false)}>Inicio</button>
      </div>
    </header>
  );
};
